script: |
  super -f text -I q11149.spq | sort > q11149.out

inputs:
  - name: q11149.spq
    data: |
      SELECT ALL + COUNT ( * ) + - - 6 + - COUNT ( * ) AS col1 FROM tab2 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q11149.out
    data: |
      6
